        self.label_16.setText(_translate("MainDialog", "<html><head/><body><p><span style=\" font-size:14pt; font-weight:600;\">Info</span></p><p><span style=\" font-size:9pt; font-weight:600;\">Metode:</span><span style=\" font-size:9pt;\"><br/>Den overordnede metode følger LCA-metodikken som beskrevet i standarderne DS/EN 15978 Bæredygtighed inden for byggeri og anlæg - Vurdering af bygningers miljømæssige kvalitet - Beregningsmetode og DS/EN ISO 14040 Miljøledelse - Livscyklusvurdering - Principper og struktur.</span></p><p><span style=\" font-size:9pt;\">Livscyklusvurdering (LCA) er en international metode til at adressere potentielle miljøpåvirkninger gennem et produkts livscyklus for at træffe informerede beslutninger og undgå byrdeskift mellem sektorer og livscyklusstadier. LCA er den anerkendte beregningsmetode til vurdering af bygningers og andre byggearbejders miljømæssige ydeevne (EN 15978).</span></p><p><span style=\" font-size:9pt;\">Byområder defineres som værende &quot;bestående af bygninger samt mellemrummene og infrastrukturen i mellem dem, hvis udformning i høj grad påvirker det overordnede systems miljømæssige ydeevne.&quot; (Hauscild et al.). Byområder er derfor ikke kun en samling af bygninger, men derimod et samspil af bygninger, infrastruktur, rum mv., der præger både beboeres og besøgendes adfærd og dermed også deres forbrug og miljøpåvirkninger.</span></p><p><span style=\" font-size:9pt;\">Ved at tage livscyklusperspektivet er det muligt for en LCA at tage højde for de processer, som er nødvendige for at produktets funktion kan opnås gennem hele dens livscyklus. I henhold til EN 15978 omfatter LCA\'er for byggeri og anlæg følgende livscyklusfaser:</span></p><p><span style=\" font-size:9pt;\">• Produktion (A1-A3)<br/>• Byggeproces (A4-A5)<br/>• Brug (B1-B7)<br/>• Endt levetid (C1-C4)<br/>• Udenfor projektet (D)</span></p><p><span style=\" font-size:9pt; font-weight:600;\">Mængdeudtræk</span><span style=\" font-size:9pt;\">:</span></p><p><span style=\" font-size:9pt;\">Udtræk af mængder for bygninger følger Bygningsreglementets oversigt over inkluderede komponenter og metode for beregning af bygningers energiforbrug. For åbne overflader følger mængdeudtrækket metoden som opstillet i InfraLCA af Vejdirektoratet.</span></p><p><span style=\" font-size:9pt; font-weight:600;\">Datakilder:</span></p><p><span style=\" font-size:9pt;\">Datakilderne til baggrund for beregningerne i værktøjet følger standarden DS/EN 15804 Bæredygtighed inden for byggeri og anlæg - Miljøvaredeklarationer - Grundlæggende regler for produktkategorien byggevarer. Overordnet set består datakilderne af:</span></p><p><span style=\" font-size:9pt;\">• Ökobaudat (materialer for bygninger)<br/>• InfraLCA (materialer for anlæg)<br/>• Branche-specifikke EPD\'er (materialer for bygninger og anlæg)<br/>• Climate Positive Design (kulstofbinding for landskab)</span></p><p><span style=\" font-size:9pt;\">En LCA er kun så pålidelig som dens data. Resultaterne af vurderingen vil derfor afhænge af nøjagtigheden af dataene, som bør matche det stadie, hvor LCA\'en udføres. Som defineret i DS/EN 15978 er de foretrukne data i konceptfasen (som matcher den urbane skala) hovedsageligt generiske og branche-specifikke værdier.</span></p><p><span style=\" font-size:9pt;\">• Branchedata repræsenterer en type produkt fra flere producenter og er baseret på gennemsnitsdata, hvilket gør det muligt at sammenligne produkter uden en specifik producent.<br/>• Generiske data er hentet fra en tredjepartsdatabase og indsamles derfor ikke direkte fra et specifikt produkt. Eksempler er den tyske database for byggematerialer Ökobaudat, den danske database for anlægsmaterialer InfraLCA fra Vejdirektoratet og den globale database for kulstofbinding Climate Positive Design.</span></p><p><span style=\" font-size:9pt; font-weight:600;\">Generelt</span></p><p><span style=\" font-size:9pt;\">Se den publicerede guide på </span><a href=\"www.kk.dk/PlanCO2_guide\"><span style=\" text-decoration: underline; color:#0000ff;\">www.kk.dk/PlanCO2_guide</span></a><span style=\" font-size:9pt;\"> for mere information om metode, mængdeudtræk og datakilder.</span></p></body></html>"))
